import styles from "./Logos.module.css";
import { SiAsus, SiApple, SiXiaomi, SiSamsung } from "react-icons/si";
const Logos = () => {
  return (
    <div className={styles.logosWrapper}>
      <div className={styles.logosFlex}>
        <div className={styles.logosItems}>
          <SiAsus size={"10rem"} fill={"#C9CBD0"} />
        </div>
        <div className={styles.logosItems}>
          <SiApple size={"10rem"} fill={"#C9CBD0"} />
        </div>
        <div className={styles.logosItems}>
          <SiXiaomi size={"15rem"} fill={"#C9CBD0"} />
        </div>
        <div className={styles.logosItems}>
          <SiSamsung size={"10rem"} fill={"#C9CBD0"} />
        </div>
        <div className={styles.logosItems}>
          <SiAsus size={"10rem"} fill={"#C9CBD0"} />
        </div>
        <div className={styles.logosItems}>
          <SiAsus size={"10rem"} fill={"#C9CBD0"} />
        </div>
      </div>
    </div>
  );
};
export default Logos;
